import React from 'react';
import { Loader } from '@googlemaps/js-api-loader';

const Map = () => {

    const loader = new Loader({
        apiKey: "",
        version: "weekly",
        libraries: ["places"]
    });
      
    const mapOptions = {
        center: {
          lat: 0,
          lng: 0
        },
        zoom: 4
    };

    loader
    .load()
    .then((google) => {
        new google.maps.Map(document.getElementById("map"), mapOptions);
    })
    .catch(e => {
        console.log(e)
    });

    return (
        <div id="google-map" style={{ width: '400px', height: '300px' }}>
        </div>
    )
}

export default Map;
